branchCategory.description:
&lt;p&gt;
The C76 series air cylinders offer a simple, space saving design with high dimensional accuracy, making these cylinders very easy to use. Large spanner flats on the rod and head covers greatly simplify their installation and positioning. Low friction and the standard elastomer cushion rings allow piston speeds up to 1500mm/sec. Greater side loads are allowed due to the close tolerance of the piston rod in the front-end bush.
&lt;/p&gt;

